INSERT INTO `z_forum` VALUES (1,1,1462906415,1,0,6,17,20,'~Introducao~\r\nPlayOld e um servidor de Tibia 7.4 para os amantes, quem tem um desejo de relembrar os velhos e bons momentos e fornecer muita diversao para os nossos jogadores.\r\nEste projeto e totalmente baseado na versao antiga, mas com alguns ajustes para o melhor desempenho e divertido para todos os jogadores.\r\nPor enquanto havera algumas atualizacoes para melhorar jogo para todos.\r\n\r\n~Features~\r\nPort Hope\r\nDemon Oak Quest\r\nPits of inferno Quest\r\nTask System\r\nNao tem proibicao de BOT (porem nao abuse)\r\nBaixe o cliente em nosso site e venha se divertir.\r\n\r\n<center><b>IMAGES</b>\r\n<img src=\"https://scontent-gru2-1.xx.fbcdn.net/v/t1.0-9/11813400_677939909017444_4620549964702412984_n.png?oh=36da563c67655805b6c57701ea910076&oe=57DF1BF0\">\r\n\r\n<img src=\"https://scontent-gru2-1.xx.fbcdn.net/v/t1.0-9/11813400_677939912350777_6882688445427051115_n.png?oh=e3bdd0821d5f4ea68428528515bdfbf1&oe=57A1F2EE\">\r\n\r\n<img src=\"https://scontent-gru2-1.xx.fbcdn.net/v/t1.0-9/11813400_677939919017443_6012448678072090090_n.png?oh=ae4555110f6bdb09b137cb3d39c82677&oe=57B066DE\"></center>','Welcome to PlayOld!',0,1462906415,17,1462907175,'200.103.70.21',0,0);
/*!40000 ALTER TABLE `z_forum` ENABLE KEYS */;
UNLOCK TABLES;

