INSERT INTO `z_news_big` VALUES (1,1352212684,'[ADM]-Beckman',2240600,4,'Start MegaTibia','</br><img src=\"images/letters/E.gif\" alt=\"\"/>stamos de volta galera, a pedidos de muitos e tambm uma imensa vontade prpria de toda a equipe, decidimos e conseguimos retornar com o <b>TibiaMax</b> ou pra outros <b>MegaTibia</b>. Temos grandes perspectivas de da tudo certo dessa vez, e tenho certeza que ajuda de todos vocs no vai faltar. Sem duvidas vocs  a pea fundamental pra tudo da certo e quero contar com todos vocs, os que j participaram do servidor passado e de todos os novos players, os que esto com a agente e os ainda iram chegar, peo que divulguem o Server, que nos ajude a encontra os erros, para assim podermos ajust-los.</br></br>\r\n<img src=\"images/letters/F.gif\" alt=\"\"/>izemos algumas alteraes sobre items vip, diminumos danos e certos poderes, sei que muitos no gostam de item vip no Server, mais sei tambm que no dia que os que no gostam passarem a ter item vip iro muda de opinio. No mudamos muito, no mapa mesmo no mechemos em nada, no fizemos nenhuma alterao de quest e scripts, ficamos com a verso do tbia 8.60 porque pra ns da Equipe TibiaMax  a melhor verso de tbia comparada com a mais recentes e creio que vocs tambm tenham a mesma opinio.</br></br>\r\n<img src=\"images/letters/A.gif\" alt=\"\"/>tualmente utilizamos uma mega estrutura interna de um sistema operacional e componentes  favorveis a um timo desempenho para o jogo. Utilizamos o sistema operacional <i>CentOS 6.3-64, Hynix 36GB DDR3 x8 memria RAM, Uplink speed 10000 Mbps Force Full Speed, Dual Intel Xeon-Westmere 5670-Hexcore [2.93GHz], Drive Controller Mainboard  Onboard  SATAII Controller Western Digital WD RE4 WD1003FBYX 1000GB</i> e todo esse processo de sucesso graas a ajuda fundamental de um cara top Linux Brasil o <i>Joffily</i> conhecido tambm na rea de OTServ como <i>Kel Serific</i> dono do <b>AlcatrazWolrd</b>.</br></br>\r\n<img src=\"images/letters/G.gif\" alt=\"\"/>alera mais informaes sobre o Server procurem em Server info, caso tenha duvidas nos envie um e-mail para <b>confirmacao@tibiamax.com</b>, no perca tempo faa sua doao e explore toda a rea vip cheia de monster e respawns fora do normal, seja o top, seja o melhor pvp, participe da melhor guild, traga toda sua galera, monte suas battles, resumindo ta tudo ai, s aproveitar e vamos nos ajudar para mantermos nossa diverso por vrios dias meses e anos. Mais detalhes procurem a equipe estaremos disponveis ajudar pelo e-mail, vamos est mais ativos no e-mail do que in-game, talvez in-game fica s tutores e snior tutores, utilizem sempre o help. Bom jogo e muita felicidade a todos ns!\r\n</br></br><center><font size=\"5\"><b>IP:</b> <i>venus.mega-tibia.net</i></font></center>','.','.'),(0,1388963764,'[ADM]-Beckman',4867248,0,'MegaTibia ON-line','</br><img src=\"images/letters/M.gif\" alt=\"\"/><b>egaTibia</b> <font color=\"#00CD00\"><b>ON-line</b></font>,sejam bem vindos todos os players, nosso servidor tem uma grande estrutura, muita diverso, wars, quests, ups, grandes guilds.\r\nFaa agora mesmo sua conta, convide seus amigos, monte seu team, nos ajude a divulgar nosso IP.</br></br>\r\n<img src=\"layouts/tibiacom/images/content/bullet.gif\">Fizemos algumas alteraes sobre items vip, diminumos danos e certos poderes, sei que muitos no gostam de item vip no Server, mais sei tambm que no dia que os que no gostam passarem a ter item vip iro muda de opinio. No mudamos muito, no mapa mesmo no mechemos em nada, no fizemos nenhuma alterao de quests e scripts, ficamos com a verso do tbia <b>8.60</b> porque pra ns da Equipe <b>MegaTibia</b> acreditamos ser a melhor verso de tbia comparada com a mais recentes e creio que vocs tambm tenham a mesma opinio.</br></br>\r\n<img src=\"layouts/tibiacom/images/content/bullet.gif\">Galera mais informaes sobre o Server procurem em Server info, caso tenha duvidas nos envie um e-mail para <b>confirmacao@megatibia.net</b>, no perca tempo faa sua doao e explore toda a rea vip cheia de monster e respawns fora do normal, seja o top, seja o melhor pvp, participe da melhor guild, traga toda sua galera, monte suas battles, resumindo ta tudo ai, s aproveitar e vamos nos ajudar para mantermos nossa diverso por vrios dias meses e anos. Mais detalhes procurem-nos atravs do <u>e-mail</u>, vamos est mais ativos no <u>e-mail</u> do que <b>in-game</b>, talvez <b>in-game</b> fica s <u>tutores</u> e <u>snior tutores</u>, utilizem sempre o help. Bom jogo e muita felicidade a todos ns!</br></br><center><font size=\"5\"><b>IP:</b> <i>venus.megatibia.net</i></font></center>','.','.'),(0,1391829766,'[ADM]-Beckman',2101697,0,'Resetado!','</br><img src=\"images/letters/R.gif\" alt=\"\"/>esetado, depois de alguns problemas, decepes, falhas e grandes ajustes, a Equipe decidiu resetar o servidor para renovar tudo e assim obter novamente o sucesso. </br>Nosso servidor mapa Global  um dos melhores da rea de OTserver, sem bugs, grandes hunts, raas equilibradas, uma imensa rea de VIP com grandes respawns .</br> Agradecemos muito a todos que sempre nos ajudam divulgando o Server, a todos os players que jogam se divertem no nosso servidor, aqueles que sempre esto conosco como teams que sempre jogaram e jogam..</br>\r\nEsse Server  pra valer, espero a colaborao de todos que possam nos ajudar de todas as formas e mil desculpas pelas falhas passadas e mais uma vez agora  pra valer. .</br>Dem suas sugestes opinies e criticas estamos sempre ativos no e-mail, <b>confirmao@megatibia.net</b>..</br>\r\nTodos os players que fizeram suas doaes tero seus pontos de volta e com a promoo, enviem-nos um e-mail para <b>confirmao@megaitbia.net</b> e iremos confirmar seus dados para devolver seus pontos..</br></br>\r\n<i>Divirta-se!</i></br><center><font size=\"5\"><b>IP:</b> <i>venus.megatibia.net</i></font></center>','.','.');
